import React from 'react';

function MainRightDailyStreak() {
    return (
        <div className='main-right-daily-streak'>
            <p className='main-right-streak-title'>Your daily streak: </p>
            <p>Compete with your friends! Who can maintain a larger daily streak?</p>
        </div>
    );
}

export default MainRightDailyStreak;
